import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Home from './Home';
import Login from './Login';


function App() {
  return (
    <div>
      <Router>
        <Routes>
        <Route path="/home" element={<Home/>}/> 
        <Route path="/login" element={<Login/>}/>
        </Routes>
      </Router> 
    </div>
  );
}

export default App;
